script: |
  super -f tsv -I q10402.sql | sort > q10402.out

vector: true

inputs:
  - name: q10402.sql
    data: |
      SELECT DISTINCT - 14, 18 AS col2 FROM tab1 WHERE NOT - col2 BETWEEN - + col0 * + CAST ( - col0 AS INTEGER ) AND - 99;
  - name: tab1

outputs:
  - name: q10402.out
    data: |
      -14	18
